import React from 'react';
import {Signup} from "./components/signup";
import {Signin} from "./components/signin"
import Wave from "react-wavify";

function App() {
  return (
      <>
          <Signup/>
          <Wave fill='#1a2848'
                paused={false}
                options={{
                    height: 20,
                    amplitude: 40,
                    speed: 0.1,
                    points: 4
                }}
          />
      </>
  );
}

export default App;
